    constructor(props) {
        super(props);

        // Init an empty state
        this.state = {
            user: null,
            currentUser: null,
            urrentUserName: ' ',
            currentUserAge: null,
        };
    }

    render() {
        console.log("profil", this.props.selectedUser)
        return (
            this.props.selectedUser ?
                <Card>
                    <Card.Body>
                        <Card.Title>Card Title</Card.Title>
                        <Card.Text>
                            Name: {this.props.selectedUser.name} <br></br>
                            Alter: {this.props.selectedUser.age}
